import "./style.css";
export const NavBar = () => {
  return (
    <nav>
      <img
        className="web-logo"
        src="https://www.starz.com/assets/images/icons/starz-logo-glint.svg"
        alt="web-logo"
      />
    </nav>
  );
};
export default NavBar;
